our %Peaks;
foreach my $peak (@$data) {
  $peak->{name} =~ s/^\"//;
  if ($peak->{name} =~ s/\"$//) {
    $peak->{'unofficial-name'} = 1;
  }
  $peak->{name} =~ s/(.*), (Mount)/$1 $2/;
  $peak->{name} =~ s/(.*), (The)/$2 $1/;
  $peak->{name} =~ s/\bSt\./Saint/;
  $peak->{name} =~ s/\bMt\./Mount/;
  $peak->{name} =~ s/^(.*) Mount$/Mount $1/;
  if ($peak->{name} =~ s/^(\d+)$/Point $1/) {
    $peak->{'unofficial-name'} = 1;
  }
  my $lat = -$peak->{coordinates}{longitude};
  $lat =~ s/^\+//;
  my $lon = -$peak->{coordinates}{latitude};
  $lon =~ s/^\+//;
  $peak->{coordinates}{latitude} = $lat;
  $peak->{coordinates}{longitude} = $lon;

  $Peaks{$peak->{name}}{$peak->{quad}} = $peak;
}
